import React from "react";
import logo from "./logo.svg";
import "./App.css";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>React + PHP Shopping Cart</h1>
      </header>
      <main>
        <ul>
          <li>Register</li>
          <li>Catalog</li>
          <li>Shopping Cart</li>
        </ul>
      </main>
    </div>
  );
}

export default App;
